import "./card.styles.css"

export const Card = (props) => (
    <div className='card-container'>  
        {/* <img src={`https://robohash.org/${props.monster.id}?set=set2&size=180x180`} alt="Monster"/> */}
        <h2>{props.attributes.Country_Region}</h2>
        <p>{props.attributes.Confirmed}</p>
        <p> {props.attributes.Deaths} </p>
        <p> {props.attributes.Recovered} </p>
        <p> {props.attributes.Active} </p>
    </div>
);
